import { MenuItem } from "./MenuItem";

export const Menu = (props) => {
  const menuItemsList = [
    "about",
    "employees",
    "schedule",
    "news",
    "media",
    "contacts",
  ];
  const menuItemsText = [
    "О студии",
    "Наша команда",
    "Расписание",
    "Новости",
    "Галерея",
    "Контакты",
  ];

  menuItemsList.map((menuItem, key) => {
    return <MenuItem item={menuItem} text={key} />;
  });
};
